function check(item, playSound, doAlert) {
    if (item.kind === "regex") {
        let regex = new RegExp(item.value, "g")
        let body = document.body.innerText
        if (body.match(regex)) {
            if (doAlert) alert("Regex found!")
            if (playSound) playBeep()
        }
    } else {
        let regex = new RegExp(`(${item.value})`, "g")
        let body = document.body.innerText
        if (body.match(regex)) {
            if (doAlert) alert("Word found!")
            if (playSound) playBeep();
        }
    }
}

chrome.storage.sync.get({
    storage: [],
    time: 1000,
    interval: 0,
    playSound: false,
    alert: true,
  }, (items) => {
    setTimeout(() => {
        items.storage.forEach(item => {
            check(item, items.playSound, items.alert)
        });
        if (items.interval != 0) {
            const checkAll = () => {
                items.storage.forEach(item => {
                    check(item, items.playSound, items.alert)
                });
                setTimeout(checkAll, items.interval)
            };
            setTimeout(checkAll, items.interval)
        }
    }, items.time)
    
});

function playBeep() {
    const audio = new Audio('data:audio/wav;base64,');
                audio.play();
}
